### Step 1: Set Up Your React Environment

First, ensure you have Node.js and npm installed on your machine. Then, create a new React app using Create React App:

```bash
npx create-react-app kanban-board
cd kanban-board
```

### Step 2: Install Necessary Libraries

For handling drag-and-drop functionality, you can use the `react-beautiful-dnd` library, which is specifically designed for this purpose.

```bash
npm install react-beautiful-dnd
```

### Step 3: Create the Kanban Board Components

Create a new file named `KanbanBoard.js` inside the `src` directory.

```jsx
// src/KanbanBoard.js
import React, { useState } from 'react';
import { DndProvider, Draggable, Droppable } from 'react-beautiful-dnd';

const initialCards = [
  { id: '1', content: 'Card 1' },
  { id: '2', content: 'Card 2' },
  { id: '3', content: 'Card 3' },
];

const KanbanBoard = () => {
  const [cards, setCards] = useState(initialCards);

  const handleDragEnd = (result) => {
    if (!result.destination) return;

    const items = Array.from(cards);
    const [reorderedItem] = items.splice(result.source.index, 1);
    items.splice(result.destination.index, 0, reorderedItem);

    setCards(items);
  };

  return (
    <DndProvider>
      <div style={{ display: 'flex', gap: '16px' }}>
        <div style={{ width: '300px', border: '1px solid #ccc', padding: '8px' }}>
          <h3>To Do</h3>
          <Droppable droppableId="todo">
            {(provided) => (
              <div ref={provided.innerRef} {...provided.droppableProps}>
                {cards.filter((card) => card.content.includes('To Do')).map((card, index) => (
                  <Draggable key={card.id} draggableId={card.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          userSelect: 'none',
                          padding: '8px',
                          margin: '4px 0',
                          border: '1px solid #ccc',
                          backgroundColor: '#f9f9f9',
                          ...provided.draggableProps.style,
                        }}
                      >
                        {card.content}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>
        </div>

        <div style={{ width: '300px', border: '1px solid #ccc', padding: '8px' }}>
          <h3>In Progress</h3>
          <Droppable droppableId="in-progress">
            {(provided) => (
              <div ref={provided.innerRef} {...provided.droppableProps}>
                {cards.filter((card) => card.content.includes('In Progress')).map((card, index) => (
                  <Draggable key={card.id} draggableId={card.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          userSelect: 'none',
                          padding: '8px',
                          margin: '4px 0',
                          border: '1px solid #ccc',
                          backgroundColor: '#f9f9f9',
                          ...provided.draggableProps.style,
                        }}
                      >
                        {card.content}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>
        </div>

        <div style={{ width: '300px', border: '1px solid #ccc', padding: '8px' }}>
          <h3>Done</h3>
          <Droppable droppableId="done">
            {(provided) => (
              <div ref={provided.innerRef} {...provided.droppableProps}>
                {cards.filter((card) => card.content.includes('Done')).map((card, index) => (
                  <Draggable key={card.id} draggableId={card.id} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          userSelect: 'none',
                          padding: '8px',
                          margin: '4px 0',
                          border: '1px solid #ccc',
                          backgroundColor: '#f9f9f9',
                          ...provided.draggableProps.style,
                        }}
                      >
                        {card.content}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>
        </div>
      </div>
    </DndProvider>
  );
};

export default KanbanBoard;
```

### Step 4: Use the Kanban Board Component

Now, you need to use the `KanbanBoard` component in your main `App.js` file.

```jsx
