import React from 'react';
import KanbanBoard from './KanbanBoard';

function App() {
  return (
    <div className="App">
      <h1>Kanban Board</h1>
      <KanbanBoard />
    </div>
  );
}

export default App;
```

### Step 5: Run Your Application

Finally, run your application to see the Kanban board in action:

```bash
npm start
```

