```

### Delegate

A **delegate** is like a helper that takes care of specific tasks on behalf of another object. In Swift, a delegate is used when one object needs to notify another object about certain events or actions without knowing exactly which object will handle those actions.

#### Example:
Imagine you're playing a game where you need to tell your friend when you score a point. Instead of always calling your friend directly, you give them a "delegate" role. When you score a point, you simply say, "Delegate, I scored!" Your friend then handles the action of celebrating or recording the score.

In Swift, you can set up a delegate like this:

```swift
// A simple protocol to define the actions a delegate should perform
protocol ScoreDelegate {
    func onScore()
}

// A player who scores points
