    var delegate: ScoreDelegate?

    func score() {
        print("Player scored!")

        // If there's a delegate, call its method
        if let del = delegate {
            del.onScore()
        }
    }
}

// A friend who can be the delegate
class Friend: ScoreDelegate {
    func onScore() {
        print("Yay! A point was scored!")
    }
}

// Using the delegate
let player = Player()
let friend = Friend()

player.delegate = friend  // Assigning the friend as the delegate
player.score()            // Output: Player scored!
