```csharp
using System;
using Xamarin.Forms;

namespace StopwatchApp
{
    public partial class StopwatchPage : ContentPage
    {
        private DateTime startTime;
        private bool isRunning = false;

        public StopwatchPage()
        {
            InitializeComponent();
            BindingContext = this;
        }

        public string ElapsedTime { get; private set; } = "00:00:00";

        public bool CanStart => !isRunning;

        public bool CanStop => isRunning;

        public bool CanPause => isRunning;

        private void StartStopwatch(object sender, EventArgs e)
        {
            if (!isRunning)
            {
                startTime = DateTime.Now;
                isRunning = true;
                StartButton.IsEnabled = false;
                StopButton.IsEnabled = true;
                PauseButton.IsEnabled = true;
            }
        }

        private void StopStopwatch(object sender, EventArgs e)
        {
            isRunning = false;
            startTime = DateTime.MinValue;
            ElapsedTime = "00:00:00";
            StartButton.IsEnabled = true;
            StopButton.IsEnabled = false;
            PauseButton.IsEnabled = false;
        }

        private void PauseStopwatch(object sender, EventArgs e)
        {
            isRunning = false;
            ElapsedTime = DateTime.Now.Subtract(startTime).ToString(@"mm\:ss");
            StartButton.IsEnabled = true;
            StopButton.IsEnabled = true;
            PauseButton.IsEnabled = false;
        }

        private void UpdateElapsed(object sender, EventArgs e)
        {
            if (isRunning)
            {
                ElapsedTime = DateTime.Now.Subtract(startTime).ToString(@"mm\:ss");
            }
        }
    }
}
```

