});

chrome.runtime.onStartup.addListener(() => {
  console.log("Extension started");
});
```

#### Step 4: Popup Script (popup.html and popup.js)

The popup script allows users to interact with the extension via a small window.

**popup.html**
```html
<!DOCTYPE html>
<html>
<head>
  <title>Popup</title>
  <style>
    body { width: 200px; }
    input { width: 100%; }
  </style>
</head>
