  <input type="text" id="textInput" placeholder="Enter text">
  <button onclick="sendMessage()">Send</button>
</body>
<script src="popup.js"></script>
</html>
```

**popup.js**
```javascript
function sendMessage() {
  const message = document.getElementById('textInput').value;
  chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
    chrome.tabs.sendMessage(tabs[0].id, { message: message }, (response) => {
      console.log(response);
    });
  });
}
```

#### Step 5: Content Script (content.js)

The content script runs in the context of web pages and can manipulate the DOM or send messages to the background script.

```javascript
// content.js
chrome.runtime.onMessage.addListener((request, sender, sendResponse) => {
  if (request.message) {
    document.body.innerHTML += `<p>${request.message}</p>`;
  }
});
```

#### Step 6: Options Page (options.html and options.js)

The options page allows users to configure the settings of the extension.

**options.html**
```html
<!DOCTYPE html>
<html>
<head>
  <title>Options</title>
  <style>
    body { width: 200px; }
  </style>
</head>
