  <script src="options.js"></script>
</body>
</html>
```

**options.js**
```javascript
document.getElementById('enableFeature').addEventListener('change', (event) => {
  chrome.storage.sync.set({ enableFeature: event.target.checked });
});
```

#### Step 7: Connecting to External APIs

If your extension needs to connect to external APIs, you will need to handle OAuth2 authentication or API keys. For demonstration purposes, let's assume you have an API endpoint:

