#### Step 8: Testing Your Extension

1. Open Chrome and go to `chrome://extensions/`.
2. Enable "Developer mode".
3. Click "Load unpacked" and select your extension's directory.

#### Step 9: Debugging Tips

- Use `console.log()` statements to debug your code.
- Use the Chrome Developer Tools to inspect network requests and console output.

