      clientX: 0,
      clientY: 0,
    });
    window.dispatchEvent(event);

    expect(useRefMock).toHaveBeenCalledWith();
    expect(document.addEventListener).toHaveBeenCalledWith(
      'mousedown',
      expect.any(Function),
    );
    expect(onClickAwayMock).toHaveBeenCalled();
  });

  it('should not call onClickAway when clicking inside the ref element', () => {
    const onClickAwayMock = jest.fn();

    const { result } = renderHook(() =>
      useClickAway({
        ref: useRefMock(),
        onClickAway: onClickAwayMock,
        shouldTriggerClickAway: true,
      }),
    );

    // Simulate mousedown event inside the ref element
    const event = new MouseEvent('mousedown', {
      clientX: 10,
      clientY: 10,
    });
    const mockElement = document.createElement('div');
    mockElement.id = 'mockElement';
    mockElement.style.position = 'absolute';
    mockElement.style.left = '0px';
    mockElement.style.top = '0px';
