### Prerequisites

1. **WordPress REST API**: Ensure your WordPress site is set up with the REST API plugin enabled.
2. **Next.js Application**: Have a basic Next.js app set up.
3. **Authentication**: You can use JWT (JSON Web Tokens) or OAuth for authentication. For simplicity, I'll use JWT here.

### Steps

#### 1. Install Dependencies

First, install the necessary packages:

```bash
npm install axios jsonwebtoken
```

#### 2. Create an Authentication Helper

Create a helper function to handle JWT authentication.

```javascript
// utils/auth.js

import jwt from 'jsonwebtoken';

const secretKey = process.env.JWT_SECRET_KEY;

export const authenticateJWT = (req, res, next) => {
  const token = req.headers.authorization?.split(' ')[1];

  if (!token) {
    return res.status(401).json({ message: 'No token provided' });
  }

  try {
    const decoded = jwt.verify(token, secretKey);
    req.user = decoded;
    next();
  } catch (error) {
    res.status(403).json({ message: 'Invalid token' });
  }
};
```

#### 3. Create a Comment Post API Route

Create a route in your Next.js app to handle the comment posting.

```javascript
// pages/api/comment.js

import { authenticateJWT } from '../../utils/auth';
import axios from 'axios';

export default async function handler(req, res) {
  if (req.method === 'POST') {
    const { post_id, comment_text } = req.body;

    if (!post_id || !comment_text) {
      return res.status(400).json({ message: 'Missing required fields' });
    }

    // Assuming you have a JWT in the header
    await authenticateJWT(req, res);

    const token = req.headers.authorization.split(' ')[1];
    const decoded = jwt.decode(token, { complete: true });

    const commentData = {
      post: post_id,
      author: decoded.payload.sub,
      content: comment_text,
    };

    try {
      const response = await axios.post(
        `${process.env.NEXT_PUBLIC_WP_API_URL}/comments`,
        commentData,
        {
          headers: {
            'Content-Type': 'application/json',
            Authorization: `Bearer ${token}`,
          },
        }
      );

      res.status(201).json(response.data);
    } catch (error) {
      console.error(error);
      res.status(500).json({ message: 'Error posting comment' });
    }
  } else {
    res.setHeader('Allow', ['POST']);
    res.status(405).end(`Method ${req.method} Not Allowed`);
  }
}
```

