In Next.js 13, you can use the `useServer` hook along with the `createServerComponentClient` to handle server-side logic for an iframe. However, if you're looking to embed an iframe on the client side and fetch data from the server, you can use API routes or `getServerSideProps`/`getStaticProps` to pre-fetch data.

Here's how you can set up an iframe using both client-side and server-side logic in Next.js 13:

### 1. Using `getServerSideProps` (Server-Side Rendering)

If you want to fetch data from the server before rendering the page, you can use `getServerSideProps`.

```javascript
// pages/my-page.js
import { useEffect } from 'react';

export async function getServerSideProps() {
  // Fetch data from the server
  const response = await fetch('https://example.com/api/data');
  const data = await response.json();

  return {
    props: {
      data,
    },
  };
}

export default function MyPage({ data }) {
  useEffect(() => {
    console.log(data);
  }, [data]);

  return (
    <div>
      <h1>My Page</h1>
      <iframe
        src="https://example.com/frame"
        title="Embedded Frame"
        frameBorder="0"
        width="600"
        height="400"
      ></iframe>
    </div>
  );
}
```

### 2. Using API Routes

If you need more control over the data fetching process, you can use API routes to fetch data and then pass it to your component.

#### Create an API Route

Create a file at `pages/api/getData.js`:

```javascript
export default async function handler(req, res) {
